import React from "react";
import ReactDOM from "react-dom";

//const element = <h1>Hello!</h1>;

class Kompo extends React.Component {
  render() {
    return (
      <button>
        <img src="https://pbs.twimg.com/profile_images/468363351039303681/gsHwdtsY.png" />
      </button>
    );
  }
}

ReactDOM.render(<Kompo />, document.getElementById("root"));
